d2c26cf1-2263-4164-8a35-b907a951b80f	3	Evolucin de Software	Sistemas Legados: Cambios de software y Preocupaciones (concerns), Evolucin, Mantenimiento y Reingeniera de Software, Refactoring, Rediseo: Migracin de Arquitecturas Monolticas a Arquitecturas Modulares, Basadas en Microservicios, o Microservicios Guiadas por Eventos., Reutilizacin de Software: Bibliotecas, Frameworks, Componentes, Patrones de Diseo y Lneas de Producto de Software 6. ESTRATEGIAS DE ENSEANZA APRENDIZAJE 6.1. Mtodos Mtodo expositivo en las clases tericas, Mtodo de elaboracin conjunta en las aulas prcticas y en la elaboracin del proyecto de investigacin, 6.2. Medios Pizarra, presentaciones, videos, software y guas de prctica. 6.3. Formas de organizacin i. Clases tericas: Conceptos ii. Practicas: Aplicacin de Conceptos iii. Laboratorio: Uso de Herramientas de Software iv. Otro: Presentaciones, videos 6.4. Programacin de actividades de investigacin formativa y responsabilidad social i. Investigacin Formativa: Proyecto Final de Investigacin o Implementacin ii. Responsabilidad Social: Producir presentaciones o tutoriales sobre los recursos de software utilizados en laboratorio 7. CRONOGRAMA ACADMICO SEMANA TEMA DOCENTE % ACUM. 1 Herramientas y Entornos de Ingeniera de Software E. Sarmiento 4 4.00 2 Gestin de Configuracin de Software E. Sarmiento 4 8.00 Pgina 3 / 6 3 Gestin de Versiones y Cambios E. Sarmiento 6 14.00 3 Construccin Automtica y Anlisis Esttico de Cdigo Fuente E. Sarmiento 8 22.00 4 Gestin de Entregas (release) E. Sarmiento 6 28.00 5 DevOps y CI/CD E. Sarmiento 6 34.00 Verificacin y Validacin: Control de Calidad, Inspecciones, 7 Revisiones (Complejidad Ciclomtica y Cognitiva), Auditorias y E. Sarmiento 6 40.00 Pruebas Fundamentos de Pruebas: Proceso (generacin, implementacin, ejecucin y anlisis), Tcnicas (Estticas y Dinmicas), Tipos 7 (usabilidad, confiabilidad, seguridad, desempeo y funcionalidad), E. Sarmiento 6 46.00 Niveles (unitarias, integracin, validacin y de sistema) y Estrategias (Caja blanca y caja negra) de prueba 8 Mtodos de Generacin de Casos de Prueba: Caja Blanca E. Sarmiento 6 52.00 9 Mtodos de Generacin de Casos de Prueba: Caja Negra E. Sarmiento 6 58.00 Automatizacin de Pruebas: Pruebas de Regresin, Arquitectura de Pruebas xUnit, Dobles de Prueba (Mocks, Stubs, Spies, Dummies y 10 E. Sarmiento 6 64.00 Fakes), y Enfoques de desarrollo guiado por pruebas: TDD, ATDD y BDD 11 Plan de Pruebas y Seguimiento de Defectos E. Sarmiento 4 68.00 13 Sistemas Legados: Cambios de software y Preocupaciones E. Sarmiento 4 72.00 13 (Ecvoonlcuecrinns,) Mantenimiento y Reingeniera de Software E. Sarmiento 4 76.00 14 Refactoring E. Sarmiento 8 84.00 Rediseo: Migracin de Arquitecturas Monolticas a Arquitecturas 15 Modulares, Basadas en Microservicios, o Microservicios Guiadas por E. Sarmiento 8 92.00 Eventos. Reutilizacin de Software: Bibliotecas, Frameworks, Componentes, 16 E. Sarmiento 8 100.00 Patrones de Diseo y Lneas de Producto de Software 8. ESTRATEGIAS DE EVALUACIN 8.1. Evaluacin del aprendizaje 1.- Evaluacin Continua. Se evaluar durante todo el semestre a los estudiantes considerando: 1.1. Su actitud solidaria o egosta, su inters por aprender, el que sea autodidacta y aplicacin de los contenidos, participacin en clase, el trabajo de investigacin formativa, participacin en prcticas de laboratorio, tanto para el primer parcial (EC1), segundo parcial (EC2) y tercer parcial (EC3) 2.- Evaluacin Peridica. 2.1 Primer Examen (EP1) 2.2 Segundo Examen (EP2) 2.3 Tercer Examen (EP3) 2.4 Proyecto Final (PF) de Investigacin o Implementacin 3.- Examen Subsanacin o Recuperacin (Sustitutorio): 8.2. Cronograma de evaluacin EVALUACIN FECHA DE EVALUACIN EXAMEN TEORA EVAL. CONTINUA TOTAL (%) Primera Evaluacin Parcial 01-10-2025 15% 15% 30% Pgina 4 / 6 Segunda Evaluacin Parcial 19-11-2025 15% 15% 30% Tercera Evaluacin Parcial 18-12-2025 20% 20% 40% TOTAL 100% 9. REQUISITOS DE APROBACIN DE LA ASIGNATURA Se tomar en cuenta para la aprobacin del estudiante, las normas establecidas en el Reglamento General de Evaluacin del proceso enseanza aprendizaje de la UNSA: a) El alumno tendr derecho a observar o en su defecto a ratificar las notas consignadas en sus evaluaciones, despus de ser entregadas las mismas por parte del profesor, salvo el vencimiento de plazos para culminacin del semestre acadmico, luego del mismo, no se admitirn reclamaciones, alumno que no se haga presente en el da establecido, perder su derecho a reclamo. b) Para aprobar el curso el alumno debe obtener una nota igual o superior a 10.5, en el promedio final. c) El redondeo, slo se efectuar en el clculo del promedio final, quedado expres, que las notas parciales, no se redondearn individualmente. d) El alumno que no tenga alguna de sus evaluaciones y no haya solicitado evaluacin de rezagados en el plazo oportuno, se le considerar como abandono. e) Los casos particulares por los cuales el alumno no pudo cumplir con su evaluacin en el tiempo establecido, podr tramitar ante la direccin de escuela, su respectiva justificacin, con la cual, el profesor tendr la obligacin de tomarle una nueva evaluacin, la misma que sustituir, la nota en cuestin. f) El estudiante quedar en situacin de 'abandono' si el porcentaje de asistencia es menor al ochenta (80%) por ciento en las actividades que requieran evaluacin continua (Prcticas, talleres, seminarios, etc.). g) A continuacin, se muestra la frmula de Nota Final (NF): NF= EC1*0.15 + EP1*0.15 + EC2*0.15 + EP2*0.15 + (0.5*EC3 + 0.5*PF3)*0.20 + EP3*0.20 10. BIBLIOGRAFIA: AUTOR, TTULO, AO, EDITORIAL 10.1. Bibliografa bsica obligatoria a) Pressman, R. S. and Maxim, B. (2014). Ingeniera de Software: Un Enfoque Prctico. McGraw-Hill, 8th edition. b) Sommerville, I. (2010). Ingeniera de Software. Addison-Wesley, 9th edition. c) McConnell S. (2011). Code Complete: A practical Handbook of software construction. Segunda edicin. Microsoft Press. d) Winters, T., Manshreck, T., & Wright, H. (2020). Software engineering at google: Lessons l